𝟭) 𝗛𝗮𝘃𝗲 𝗮 𝗿𝗲𝗴𝘂𝗹𝗮𝗿 𝗱𝗮𝗶𝗹𝘆 𝗽𝗹𝗮𝗻𝗻𝗶𝗻𝗴 𝘀𝗲𝘀𝘀𝗶𝗼𝗻.
Take 5 or 10 minutes every morning to go over your tasks for the next day. That refreshes in your mind what needs to be done, making it less likely for you to forget about appointments and etc.

𝟮) 𝗛𝗮𝘃𝗲 𝗮 𝗿𝗲𝗴𝘂𝗹𝗮𝗿 𝘄𝗲𝗲𝗸𝗹𝘆 𝗽𝗹𝗮𝗻𝗻𝗶𝗻𝗴 𝘀𝗲𝘀𝘀𝗶𝗼𝗻.
At the start of the week, such as Sunday evening (or whatever works best for you), take a few minutes to go over plans for the week ahead. This is your chance to plan for broader tasks that can’t be pegged to a specific day.

𝟯)𝗛𝗮𝘃𝗲 𝗮 𝗿𝗲𝗴𝘂𝗹𝗮𝗿 𝗺𝗼𝗻𝘁𝗵𝗹𝘆 𝗽𝗹𝗮𝗻𝗻𝗶𝗻𝗴 𝘀𝗲𝘀𝘀𝗶𝗼𝗻.
At the beginning of each month sit down and write in the dates which will not change. Such as doctors appointment, exams, due date for assignments, and etc.

𝟰) 𝗨𝘀𝗲 𝗮 𝘀𝗶𝗻𝗴𝗹𝗲 𝗽𝗹𝗮𝗻𝗻𝗲𝗿 𝗳𝗼𝗿 𝗲𝘃𝗲𝗿𝘆𝘁𝗵𝗶𝗻𝗴.
It’s easiest to keep it all in one place, so you don’t have to consult multiple planners or calendars. Try color-coding business and personal tasks for better separation, such as a red pen for anything relating to work. This is easiest done with a paper planner. (Highly recommend color coding it keeps everything organized.)

𝟱) 𝗠𝗮𝗸𝗲 𝘆𝗼𝘂𝗿 𝘀𝘁𝗲𝗽𝘀 𝗰𝗼𝗻𝗰𝗿𝗲𝘁𝗲.
Write in full sentences (with verbs!) to clarify what you need to do. Be specific about it as well. Write in detail.

𝟲) 𝗖𝗵𝗲𝗰𝗸 𝘆𝗼𝘂𝗿 𝗽𝗹𝗮𝗻𝗻𝗲𝗿 𝗮 𝗹𝗼𝘁.
Check it frequently and leave it somewhere obvious when you’re at home, a desk or table, ready for use. Don’t stuff it away on a shelf because it will get forgotten.

𝟳)𝗥𝗲𝗳𝗹𝗲𝗰𝘁.
At the end of the day do a reflection for each task such as how you did that task, if you didn’t do it write why, and ways to improve. So that next time if you have the same task you will know your mistake/weakness and you will try to do a better job next time.

𝟴) 𝗦𝘁𝗶𝗰𝗸𝗲𝗿𝘀 𝗮𝗻𝗱 𝗾𝘂𝗼𝘁𝗲𝘀
Add stickers and motivational quotes to help get your tasks done and pick you up whenever you are down. It will inspire you to do your best and won’t let you give up easily. 

